/*
 * Table accessor.
 */
unsigned long
idn__sparsemap_getcomposition(unsigned long v) {
	int idx0, idx1, idx2;

	if (v > UTF32_MAX)
		return (0);
	idx0 = v >> (COMPOSITION_BITS_1 + COMPOSITION_BITS_2);
	idx1 = (v >> COMPOSITION_BITS_2) & ((1 << COMPOSITION_BITS_1) - 1);
	idx2 = v & ((1 << COMPOSITION_BITS_2) - 1);
	return (unsigned long) composition_table[composition_imap[composition_imap[idx0] + idx1]].tbl[idx2];
}

const struct composition *
idn__sparsemap_getcompositionseq(unsigned long idx) {
	return composition_seq + (idx & 0xffff);
}
